import React from 'react';
import { Card, CardContent, Typography, Grid, Avatar, Divider, List, ListItem, ListItemText } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({
  root: {
    padding: '2rem',
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    backgroundColor: '#f4f6f8',
    minHeight: '100vh',
  },
  card: {
    boxShadow: '0px 4px 12px rgba(0, 0, 0, 0.1)',
    borderRadius: '12px',
    padding: '1.5rem',
    textAlign: 'center',
    backgroundColor: '#ffffff',
  },
  welcomeCard: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: '#1e88e5',
    color: '#fff',
    padding: '2rem',
    borderRadius: '12px',
    boxShadow: '0px 4px 20px rgba(0, 0, 0, 0.2)',
  },
  title: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  subtitle: {
    color: '#cfd8dc',
  },
  avatar: {
    width: 70,
    height: 70,
    backgroundColor: '#ffb300',
    fontSize: '2rem',
    marginBottom: '1rem',
  },
  sectionTitle: {
    fontWeight: 'bold',
    color: '#424242',
    marginBottom: '0.5rem',
  },
  divider: {
    margin: '1rem 0',
  },
});

const PlayerHome: React.FC = () => {
  const classes = useStyles();

  const previousMatches = [
    { date: '2024-10-20', score: '45 Runs', result: 'Won' },
    { date: '2024-10-18', score: '32 Runs', result: 'Lost' },
    { date: '2024-10-15', score: '76 Runs', result: 'Won' },
  ];

  const upcomingMatches = [
    { date: '2024-11-05', team: 'Team A' },
    { date: '2024-11-10', team: 'Team B' },
  ];

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        {/* Welcome Card */}
        <Grid item xs={12} md={8}>
          <Card className={`${classes.card} ${classes.welcomeCard}`}>
            <Avatar className={classes.avatar}>P</Avatar>
            <Typography variant="h4" className={classes.title}>
              Welcome Back, [Player Name]!
            </Typography>
          </Card>
        </Grid>
        {/* Stats Overview Card */}
        <Grid item xs={12} md={4}>
          <Card className={classes.card}>
            <Typography variant="h5" className={classes.sectionTitle}>
              Stats Overview
            </Typography>
            <Typography variant="body1">Total Matches: 25</Typography>
            <Typography variant="body1">Wins: 15</Typography>
            <Typography variant="body1">Losses: 10</Typography>
          </Card>
        </Grid>

        {/* Previous Matches Card */}
        <Grid item xs={12} md={6}>
          <Card className={classes.card}>
            <CardContent>
              <Typography variant="h5" className={classes.sectionTitle}>
                Previous Matches
              </Typography>
              <Divider className={classes.divider} />
              <List>
                {previousMatches.map((match, index) => (
                  <ListItem key={index}>
                    <ListItemText
                      primary={`Date: ${match.date}`}
                      secondary={`Score: ${match.score} - Result: ${match.result}`}
                    />
                  </ListItem>
                ))}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Upcoming Matches Card */}
        <Grid item xs={12} md={6}>
          <Card className={classes.card}>
            <CardContent>
              <Typography variant="h5" className={classes.sectionTitle}>
                Upcoming Matches
              </Typography>
              <Divider className={classes.divider} />
              <List>
                {upcomingMatches.map((match, index) => (
                  <ListItem key={index}>
                    <ListItemText primary={`Date: ${match.date}`} secondary={`Against: ${match.team}`} />
                  </ListItem>
                ))}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Team Details Card */}
        <Grid item xs={12}>
          <Card className={classes.card}>
            <CardContent>
              <Typography variant="h5" className={classes.sectionTitle}>
                Team Details
              </Typography>
              <Divider className={classes.divider} />
              <Typography variant="body1">Team Name: [Your Team]</Typography>
              <Typography variant="body1">Role: [Player Position]</Typography>
              <Typography variant="body1">Joined: [Team Join Date]</Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
};

export default PlayerHome;
